window.bookSummaryJSON = "<p>Jack wasn't always a vampire, and Angela wasn't always a werewolf—Blood at Dusk tells the stories of how they first changed, and how they then met.</p> <p>When a younger Jack runs into his high school flame at a strip club in Vegas and discovers she's in trouble, he's willing to do <i>anything</i> to save her—even if it costs him his immortal soul. Whereas when a younger, more innocent Angela and her best friend attract the attention of Gray, the Pack's leader—she thinks she wants to stay with Gray forever, until she learns the brutal truth about the Pack.</p> <p>Blood at Dusk: Dark Ink Tattoo Book Two continues both Jack and Angela's stories, how they become creatures of the night, and the lengths they're now willing to go to survive, in the vein of an absolutely scorching Sons of Anarchy.</p>"; 
